webpackJsonp([0xf86900d589fb],{1180:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2008-01-31-godaddy-epp-code/index.md absPath of file >>> MarkdownRemark",html:"<p>I keep trying to setup new websites because I like to pollute the internet.  Ok not really, but I want to setup another domain on my bluehost account because I can have as many as I like and I figure that the world could use more of my blather.  If you are transferring a domain name or need the EPP code from Godaddy.com for any reason it can be hard to find.</p>\n<p>Here's how to do it:</p>\n<ol>\n  <li>Login to Godaddy</li>\n  <li>Go to the domain you want to transfer</li>\n  <li>Look for this line:\n    <pre>\n      **Authorization Code:**\n      Send by Email\n    </pre>\n  </li>\n  <li>Click that and you will get the EPP code via email</li>\n  <li>All done</li>",frontmatter:{title:"Godaddy EPP Code",date:"January 31, 2008",imageUrl:null,image:null}}},pathContext:{path:"/godaddy-epp-code"}}}});
